import React, { Component } from 'react';
import './Content.css'

class Service extends Component {

    render() {
        return (
            <div>
                <div class="container-fluid">
                    <div class="row">
                        <div class="col-lg-12">
                            Service
                        </div>
                        
                    </div>
                </div>

            </div>
        );
    }
}
export default Service;
